import{_ as t,c as a,o as n,ae as i}from"./chunks/framework.CIFMzK_S.js";const c=JSON.parse('{"title":"","description":"","frontmatter":{"layout":"home","hero":{"name":"Deep mutational scanning of H3 influenza HA","tagline":"A collection of data, figures, and analysis for exploring pleiotropic constraints on the antigenic evolution of human H3N2 influenza virus.","image":"MA22_MDCKSIAT1_entry_mean.png"},"features":[{"title":"Cell entry","details":"Effects of mutations on cell entry","link":"/cell_entry"},{"title":"Acid stability","details":"Effects of mutations on acid stability","link":"/acid_stability"},{"title":"Sera neutralization","details":"Effects of mutations on neutralization by human sera","link":"/sera_neutralization"},{"title":"Epistatic entrenchment","details":"Explore if mutation effects have become entrenched","link":"/entrenchment"},{"title":"Summary","details":"Explore how mutations affect all measured phenotypes together","link":"/summary"}]},"headers":[],"relativePath":"index.md","filePath":"index.md"}'),s={name:"index.md"};function o(r,e,l,h,u,p){return n(),a("div",null,e[0]||(e[0]=[i('<h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">â€‹</a></h2><p>This site hosts interactive visualizations from deep mutational scanning experiments that measure the effects of mutations to the HA of A/Massachusetts/18/2022 (H3N2) influenza virus. Clicking on the links in the boxes above will take you to pages that access the visualizations.</p><p>This work was performed in the <a href="https://jbloomlab.org/" target="_blank" rel="noreferrer">Bloom lab</a>. To read the paper that describes the results, see <a href="./.html">Yu et al (2025)</a>.</p><p>Note that the experiments were performed using <a href="https://doi.org/10.1016/j.cell.2023.02.001" target="_blank" rel="noreferrer">pseudovirus deep mutational scanning</a>. These pseudoviruses encode no viral genes other than HA, and so can only undergo a <strong>single</strong> round of cell entry. These pseudoviruses are therefore not infectious agents and are not disease-causing pathogens, and so provide a safe way to study HA mutations at biosafety-level 2.</p><p>All of the plots and files here use the widely adopted <strong>H3 numbering scheme</strong>. This numbering starts with one at the first amino-acid of the ectodomain, not the N-terminal methionine. Click <a href="https://github.com/dms-vep/Flu_H3_Massachusetts2022_DMS/blob/main/data/site_numbering_map.csv" target="_blank" rel="noreferrer">here</a> for the site numbering map.</p><p>The GitHub repository with the full analysis and code is at <a href="https://github.com/dms-vep/Flu_H3_Massachusetts2022_DMS/" target="_blank" rel="noreferrer">https://github.com/dms-vep/Flu_H3_Massachusetts2022_DMS</a> and the full output of the analysis pipeline is in the <a href="appendix.html" target="_self">Appendix</a>.</p>',6)]))}const f=t(s,[["render",o]]);export{c as __pageData,f as default};
